import React from "react";
import { Redirect, Switch } from "react-router-dom";
import { ContentRoute } from "../../../_metronic/layout";
import BankList from "./bankSetup/BankList";
import BankCreate from "./bankSetup/BankCreate";
import BankBranchList from "./BankBranchList";
import BankAccountList from "./BankAccountList";
import DepartmentList from "./departmentSetup/DepartmentList";
import DepartmentCreate from "./departmentSetup/DepartmentCreate";
import StoreList from "./store/StoreList";
import StoreCreate from "./store/StoreCreate";
import UomList from "./uomSetup/UomList";
import UomCreate from "./uomSetup/UomCreate";
import PackSizeList from "./packSizeSetup/PackSizeList";
import PackSizeCreate from "./packSizeSetup/PackSizeCreate";

export default function MastarConfig() {
  return (
    <Switch>
      <Redirect
        exact={true}
        from="/mastar-config"
        to="/mastar-config/bank-setup"
      />

      <ContentRoute path="/mastar-config/bank-setup" component={BankList} />
      <ContentRoute from="/mastar-config/bank-setup-new" component={BankCreate} />

      <ContentRoute path="/mastar-config/bank-branch" component={BankBranchList} />

      <ContentRoute path="/mastar-config/bank-account" component={BankAccountList} />

      <ContentRoute path="/mastar-config/department-setup" component={DepartmentList} />
      <ContentRoute from="/mastar-config/department-setup-new" component={DepartmentCreate} />

      <ContentRoute path="/mastar-config/store-setup" component={StoreList} />
      <ContentRoute from="/mastar-config/store-setup-new" component={StoreCreate} />

      <ContentRoute path="/mastar-config/uom-setup" component={UomList} />
      <ContentRoute from="/mastar-config/uom-setup-new" component={UomCreate} />

      <ContentRoute path="/mastar-config/pack-size-setup" component={PackSizeList} />
      <ContentRoute from="/mastar-config/pack-size-setup-new" component={PackSizeCreate} />
    </Switch>
  );
}
